        public UISearchVillaPlusDocument(UITestControl searchLimitContainer) : 
                base(searchLimitContainer)
        {
            #region Search Criteria
            this.SearchProperties[HtmlDocument.PropertyNames.RedirectingPage] = "False";
            this.SearchProperties[HtmlDocument.PropertyNames.FrameDocument] = "False";
            this.FilterProperties.Add(new PropertyExpression(HtmlDocument.PropertyNames.Title, "Search | Villa Plus", PropertyExpressionOperator.Contains));
            this.FilterProperties[HtmlDocument.PropertyNames.AbsolutePath] = "/search";
            this.FilterProperties.Add(new PropertyExpression(HtmlDocument.PropertyNames.PageUrl, ".villaplus.com/search", PropertyExpressionOperator.Contains));
            this.WindowTitles.Add("Search | Villa Plus");
            #endregion
        }
        
        #region Properties
        public HtmlCustom UISearchFormCustom
        {
            get
            {
                if ((this.mUISearchFormCustom == null))
                {
                    this.mUISearchFormCustom = new HtmlCustom(this);
                    #region Search Criteria
                    this.mUISearchFormCustom.SearchProperties["TagName"] = "SECTION";
                    this.mUISearchFormCustom.SearchProperties.Add(new PropertyExpression("Id", "searchForm", PropertyExpressionOperator.Contains));
                    this.mUISearchFormCustom.FilterProperties.Add(new PropertyExpression("ControlDefinition", "id=\"searchForm\"", PropertyExpressionOperator.Contains));
                    this.mUISearchFormCustom.WindowTitles.Add("Search | Villa Plus");
                    #endregion
                }
                return this.mUISearchFormCustom;
            }
        }
        #endregion
        
        #region Fields
        private HtmlCustom mUISearchFormCustom;
        #endregion
    }
}
